import "../styles/style-stocks.css";


import Reasons from "../components/reasons/Reasons"
import {services} from "./../helpers/servicesList"

const Stocks = () => {
  return (
    <main>
      <section className="stocks">
        <div className="container">
          <div className="stocks__inner">
            <h1 className="stocks__title">Новости и акции</h1>
            <div className="stocks__list">
              {services.map((project) =>{
                return <Stocks key={project.id} title={project.title} img={project.img} service_num={project.service_num}/>
              })}
            </div>
          </div>
        </div>
      </section>
    </main>
  );
};

export default Stocks;
